import React from "react";
import Icon_Home from "react-native-vector-icons/AntDesign";
import Icon_Tours from "react-native-vector-icons/Ionicons";
import Icon_Locations from "react-native-vector-icons/Ionicons";
import Icon_Settings from "react-native-vector-icons/Ionicons";
import Icon_About from "react-native-vector-icons/Ionicons";
import { createMaterialBottomTabNavigator } from "@react-navigation/material-bottom-tabs";
import Home from "./home";
import About from "./about";
import Tours from "./tours";
import Locations from "./locations";

import Settings from "./settings";

const Tab = createMaterialBottomTabNavigator();
export default function TabNavigator() {
  return (
    <Tab.Navigator
      initialRouteName="Home"
      activeColor="#16b8f3"
      inactiveColor="#2F2F2F"
      barStyle={{ backgroundColor: "#fff", paddingBottom: 5 }}
    >
      <Tab.Screen
        name="Settings"
        component={Settings}
        options={{
          tabBarLabel: "Settings",
          tabBarIcon: ({ color }) => (
            <Icon_Settings
              name="ios-settings-outline"
              color={color}
              size={25}
            />
          ),
        }}
      />
      <Tab.Screen
        name="Tours"
        component={Tours}
        options={{
          tabBarLabel: "Tours",
          tabBarIcon: ({ color }) => (
            <Icon_Tours name="ios-map-outline" color={color} size={25} />
          ),
        }}
      />
      <Tab.Screen
        name="Home"
        component={Home}
        options={{
          tabBarLabel: "Home",
          tabBarIcon: ({ color }) => (
            <Icon_Home name="home" color={color} size={25} />
          ),
        }}
      />
      <Tab.Screen
        name="Locations"
        component={Locations}
        options={{
          tabBarLabel: "Locations",
          tabBarIcon: ({ color }) => (
            <Icon_Locations
              name="ios-location-outline"
              color={color}
              size={25}
            />
          ),
        }}
      />
      <Tab.Screen
        name="About Us"
        component={About}
        options={{
          tabBarLabel: "About",
          tabBarIcon: ({ color }) => (
            <Icon_About name="md-school-outline" color={color} size={25} />
          ),
        }}
      />
    </Tab.Navigator>
  );
}
